import React from "react";

function Login() {
  return (
    <>
      <form className="form">
        <input className="inputField" type="text" placeholder="Username" />
        <input className="inputField" type="passwordf" placeholder="Password" />
        <button type="submit">Login</button>
      </form>
    </>
  );
}
export default Login;
